import React from 'react';
import axios from 'axios';
import { useEffect, useState } from 'react';
import { useNavigate } from "react-router-dom";

export default function SearchPatients() {
    const [listOfPatients, setListofPatients] = useState([]);
     let navigate = useNavigate(); 
    const [idLength, setIdLenght] =useState ();

    useEffect(() => {
      axios.get("http://localhost:3001/patientsinfo").then((response) => {
        setListofPatients(response.data);
      })

      axios.get("http://localhost:3001/patientsinfo").then((response) => {
        setIdLenght(response.data.length);
      })

    }, []);
  
    return(
      <section>
        <div>
          {listOfPatients.map((value, key) => {
            return(
              <div onClick={() => navigate(`/patientsinfo/${value.id}`)}>
                <div
                className='p-10'
                > {value.firstName} | {value.lastName} | {value.sex}| {value.location} | {value.phoneNumber}</div>
              </div>

            )
          })}
        </div>
        <div>
          {setIdLenght}
        </div>
      </section>
    )
}
